<body>
    <script>
    // 58.	打印1到100之内的整数，但数字中包含9的要跳过  
      for (var i = 1;i<=100;i++){
          if(i%10!=9&&(i%100-i%10)/10!=9){
              console.log(i)
          }
      }
    </script>
</body>
